let CreatorName = 'Joe Seph'


export function Header() {
  return (
    <div className="bg-blue-600 shadow-md flex flex-row w-full">
    <div className="flex items-center flex-row h-12 justify-between mb-0 ml-auto mr-auto mt-0 max-w-5xl w-full">
      <span className="items-center text-white font-bold font-capitalize">
        {CreatorName}
      </span>
      <div className="flex items-center flex-row justify-center space-x-8 text-white">
        <div>
          home
        </div>
        <div>
          about
        </div>
        <div>
          contact
        </div>
      </div>
    </div>
  </div>
  );
}

export function Footer() {
  return (
    <div className="bg-blue-600 p-4 w-full">
    <div className="m-0 text-white">
      &amp;copy; Copyright 2020.
    </div>
  </div>
  );
}

